-- 3. Sales & Profit Summary by Region
SELECT Region, 
       SUM(Sales) AS TotalSales, 
       SUM(Profit) AS TotalProfit, 
       ROUND(SUM(Profit)*100.0 / NULLIF(SUM(Sales),0), 2) AS ProfitMargin
FROM [US Superstore data]
GROUP BY Region
ORDER BY TotalProfit DESC;

/* Output
